import {BrowserRouter as Router, Route} from "react-router-dom"
import './App.css';

import Home from './containers/Home/index.js'
import City from './containers/City.js'
class App extends Component {
    render(){
        return(
            <div className="App">
              <Router>
                  <Route exact path="/" component={Home} />
              </Router>
            </div>
        );
    }
}
export default App;
